{{Wiktionary|Anglo-Saxon}} '''[[Anglo-Saxons]]''' were Germanic tribes that settled in Britain and founded England.
'''Anglo-Saxon''' may also refer to: * [[Anglo-Saxon (anthropology)]] or Nordic race, one of the putative Caucasian sub-races * [[Anglo-Saxon England]], the history of Anglo-Saxons * [[Anglo-Saxon model]], modern macroeconomic term * [[Anglo-Saxon world]], modern societies based on or influenced by English customs * [[Old English]] or Anglo-Saxon, the earliest historical form of the English language * {{SS|Anglo Saxon}}, one of various ships * [[White Anglo-Saxon Protestant]], an ethnicity in the U.S.
